-- Table: customers
CREATE TABLE customers (
    id serial,
    name varchar(150) NOT NULL,
    phone varchar(50) NOT NULL,
    address varchar(150) NOT NULL,
    email varchar(100) NOT NULL,
    password varchar(50) NOT NULL,
    CONSTRAINT customers_pk PRIMARY KEY (id)
);

-- Table: orders
CREATE TABLE orders (
    id serial,
    customer_id serial NOT NULL,
    product_id serial NOT NULL,
    status varchar(50) NOT NULL,
    quantity int NOT NULL,
    discount bool NOT NULL,
    discount_value money NOT NULL,
    value money NOT NULL,
    date date NOT NULL,
    CONSTRAINT order_id PRIMARY KEY (id)
);

-- Table: payments
CREATE TABLE payments (
    id serial,
    orders_id serial NOT NULL,
    customers_id serial NOT NULL,
    type_payment varchar(50) NOT NULL,
    payment_accept bool NOT NULL,
    value money NOT NULL,
    CONSTRAINT payments_pk PRIMARY KEY (id)
);

-- Table: products
CREATE TABLE products (
    id serial,
    product varchar(100) NOT NULL,
    slug varchar(100) NOT NULL,
    description varchar(150) NOT NULL,
    category varchar(50) NOT NULL,
    size varchar(20) NOT NULL,
    color varchar(20) NOT NULL,
    image text NOT NULL,
    price money NOT NULL,
    discount boolean NOT NULL,
    discount_value int NULL,
    CONSTRAINT products_pk PRIMARY KEY (id)
);

-- foreign keys
ALTER TABLE orders ADD CONSTRAINT orders_customers FOREIGN KEY (customer_id)
    REFERENCES customers (id);


ALTER TABLE orders ADD CONSTRAINT orders_products FOREIGN KEY (product_id)
    REFERENCES products (id);


ALTER TABLE payments ADD CONSTRAINT payments_customers FOREIGN KEY (customers_id)
    REFERENCES customers (id);


ALTER TABLE payments ADD CONSTRAINT payments_orders FOREIGN KEY (orders_id)
    REFERENCES orders (id);



















 






